func SortArray(arr []int) []int {
    sort.Slice(arr, func(i, j int) bool {
        // Count the number of ones in the binary representation
        countOnes := func(x int) int {
            count := 0
            for x > 0 {
                count += x & 1
                x >>= 1
            }
            return count
        }

        // Get the number of ones for both elements
        onesI := countOnes(arr[i])
        onesJ := countOnes(arr[j])

        // Sort by number of ones, then by value
        if onesI == onesJ {
            return arr[i] < arr[j]
        }
        return onesI < onesJ
    })

    // Fix negative integers: Sort by value if the count of ones is the same
    sort.Slice(arr, func(i, j int) bool {
        if countOnes(arr[i]) == countOnes(arr[j]) {
            return arr[i] < arr[j]
        }
        return countOnes(arr[i]) < countOnes(arr[j])
    })

    return arr
